import React from 'react';
import TopButtons from '../components/TopButtons';
import { UilSun } from '@iconscout/react-unicons';

function Home({ weatherRecords }) {
  let weatherRecord;

  // Check if weatherRecords is an array and not empty
  if (Array.isArray(weatherRecords) && weatherRecords.length > 0) {
    // If it's an array, take the first element as the weatherRecord
    weatherRecord = weatherRecords[0];
  } else {
    // If it's not an array or empty, set weatherRecord to null
    weatherRecord = null;
  }

  // If weatherRecord is null, return null to avoid rendering errors
  if (!weatherRecord) return null;

  return (
    <div className="app">
      <div className="container">
        <div className="topbuttons">
          <TopButtons />
        </div>
        <div className="top">
          <div className="location">
            {weatherRecord.location && <p>{weatherRecord.location}</p>}
          </div>
          <div className="temp">
            {weatherRecord.temperature && <h1>{weatherRecord.temperature.toFixed()}Â°C</h1>}
          </div>
          <div className="description">
            {weatherRecord.weatherDescription && <p>{weatherRecord.weatherDescription}</p>}
          </div>
        </div>
        <div className="mid">
          <div className="weathericon">
            <UilSun size={200}/>
          </div>
        </div>
        <div className="bottom">
          <div className="wind">
            {weatherRecord.windSpeed && (
              <>
                <p className='bold'>{weatherRecord.windSpeed.toFixed()} km/t</p>
                <p>Vindhastighed</p>
              </>
            )}
          </div>
          <div className="direction">
            {weatherRecord.windDirection && (
              <>
                <p className='bold'>{weatherRecord.windDirection}</p>
                <p>Vindretning</p>
              </>
            )}
          </div>
          <div className="humidity">
            {weatherRecord.humidity && (
              <>
                <p className='bold'>{weatherRecord.humidity}%</p>
                <p>Luftfugtighed</p>
              </>
            )}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
